import React, { useEffect, useState } from "react";
import { Wrapper, Header, Body, Icon } from "./styles";

const OpenPanel = () => {
  const [open, setOpen] = useState(false);
  return (
    <Wrapper>
      <Header>
        <Icon />
      </Header>
      <Body></Body>
    </Wrapper>
  );
};

export default OpenPanel;
